package pacificsoft.pscomandera.Modelo;import java.io.Serializable;import java.util.List;public class ComandaArticulo implements Serializable {    private String COD_ART;    private String DES_PRO;    private double CAN_PRO;    private List<String> NotasList;    private int NUM_CTA;    private double PRE_ART;    private int position;    private String imagen = "";    private boolean expanded = false;    private int modificable = 0;    private List<ModificadorSeleccionado> modificadorSeleccionados;    public ComandaArticulo() {    }    public ComandaArticulo(String COD_ART, String DES_PRO, double CAN_PRO, List<String> notasList, int NUM_CTA, double PRE_ART, int position, String imagen, boolean expanded, int modificable, List<ModificadorSeleccionado> modificadorSeleccionados) {        this.COD_ART = COD_ART;        this.DES_PRO = DES_PRO;        this.CAN_PRO = CAN_PRO;        NotasList = notasList;        this.NUM_CTA = NUM_CTA;        this.PRE_ART = PRE_ART;        this.position = position;        this.imagen = imagen;        this.expanded = expanded;        this.modificable = modificable;        this.modificadorSeleccionados = modificadorSeleccionados;    }    public String getCOD_ART() {        return COD_ART;    }    public void setCOD_ART(String COD_ART) {        this.COD_ART = COD_ART;    }    public String getDES_PRO() {        return DES_PRO;    }    public void setDES_PRO(String DES_PRO) {        this.DES_PRO = DES_PRO;    }    public double getCAN_PRO() {        return CAN_PRO;    }    public void setCAN_PRO(double CAN_PRO) {        this.CAN_PRO = CAN_PRO;    }    public int getNUM_CTA() {        return NUM_CTA;    }    public void setNUM_CTA(int NUM_CTA) {        this.NUM_CTA = NUM_CTA;    }    public double getPRE_ART() {        return PRE_ART;    }    public void setPRE_ART(double PRE_ART) {        this.PRE_ART = PRE_ART;    }    public int getPosition() {        return position;    }    public void setPosition(int position) {        this.position = position;    }    public String getImagen() {        return imagen;    }    public void setImagen(String imagen) {        this.imagen = imagen;    }    public boolean isExpanded() {        return expanded;    }    public void setExpanded(boolean expanded) {        this.expanded = expanded;    }    public int getModificable() {        return modificable;    }    public void setModificable(int modificable) {        this.modificable = modificable;    }    public List<String> getNotasList() {        return NotasList;    }    public void setNotasList(List<String> notasList) {        NotasList = notasList;    }    public List<ModificadorSeleccionado> getModificadorSeleccionados() {        return modificadorSeleccionados;    }    public void setModificadorSeleccionados(List<ModificadorSeleccionado> modificadorSeleccionados) {        this.modificadorSeleccionados = modificadorSeleccionados;    }}